EXHIBIT A TO SHARED FACILITIES AGREEMENT
Shared Facilities The "Shared Facilities" shall consist of the following facilities: 1. The approximately 0.5 mile 115 kV Gen-tie line originating from the Chaves step-up substation dead end structure and terminating at the Southwestern Public Service Company Chaves County Interchange substation;
2. The Southwestern Public Service Company Chaves County Interchange substation, including [the 34.5kV to 115kV 110 MW generator step-up transformer, associated metering equipment, breakers, buses, control equipment and other related equipment that transforms energy collected to the 114kV voltage level. All other Interconnection Customer Interconnection Facilities owned or leased, and used by Chaves or Chaves II shall not constitute "Shared Facilities" for purposes of this Agreement.
